import React, { Component } from 'react';
import HomeAnimation from './HomeAnimation';

class Home extends Component {
  render() {
    return (
      <div id='home' className='component'>
        <h1>Hi, I'm Jacqueline & I'm a Full-stack Software Engineer.</h1>
        <HomeAnimation />
      </div>
    )
  }
}

export default Home
